import React, { useContext } from 'react';
import './style/index.css';
import { contextApi } from './ContextApi';

function Test1() {
  const { article } = useContext(contextApi);

  function changeInput(e){
    console.log(e)
  }
  return (
    <div>
      <input type="text" onChange={changeInput()} />
      <button>search</button>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Author</th>
            <th>Comments</th>
            <th>Title</th>
            <th>URL</th>
            <th>Remove</th>
          </tr>
        </thead>
        <tbody>
          {[...article].map((item) => (
            <tr>
              <td>{item.objectID}</td>
              <td>{item.author}</td>
              <td>{item.num_comments}</td>
              <td>{item.title}</td>
              <td>{item.url}</td>
              <td>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button>顯示更多</button>
    </div>
  );
}

export default Test1;
